import React, { Component } from 'react';
import html2canvas from 'html2canvas';
import jsPDF from "jspdf";
import "jspdf-autotable";
class BtnExport extends Component{

    constructor(props){
        super(props);
        this.state = {
            tableData: props.tableData
        };
        this.printDocument = this.printDocument.bind(this);
    }


    printDocument() {
        var pdf = function (graf, columns, rows) {
            function Reloj() {
                var marcacion = new Date()
                /* Capturamos la Hora */
                var Hora = marcacion.getHours()
                /* Capturamos los Minutos */
                var Minutos = marcacion.getMinutes()
                /* Capturamos los Segundos */
                var Segundos = marcacion.getSeconds()
                /*variable para el ap�strofe de am o pm*/
                var dn = "a.m"
                if (Hora > 12) {
                    dn = "p.m"
                    Hora = Hora - 12
                }
                if (Hora == 0)
                    Hora = 12
                /* Si la Hora, los Minutos o los Segundos son Menores o igual a 9, le a�adimos un 0 */
                if (Hora <= 9) Hora = "0" + Hora
                if (Minutos <= 9) Minutos = "0" + Minutos
                if (Segundos <= 9) Segundos = "0" + Segundos
                /* Termina el Script del Reloj */

                /*Script de la Fecha */

                var Dia = new Array("Domingo", "Lunes", "Martes", "Mi�rcoles", "Jueves", "Viernes", "Sabado", "Domingo");
                var Mes = new Array("Enero", "Febrero", "Marzo", "Abril", "Mayo", "Junio", "Julio", "Agosto", "Septiembre",
                    "Octubre", "Noviembre", "Diciembre");
                var Hoy = new Date();
                var Anio = Hoy.getFullYear();
                var Fecha = Dia[Hoy.getDay()] + ", " + Hoy.getDate() + " de " + Mes[Hoy.getMonth()] + " de " + Anio + ". ";

                /* Termina el script de la Fecha */

                /* Creamos 2 variables para darle formato a nuestro Script */
                var Script, Total;

                /* En Reloj le indicamos la Hora, los Minutos y los Segundos */
                Script = Fecha + Hora + ":" + Minutos + ":" + Segundos + " " + dn;

                /* En total Finalizamos el Reloj uniendo las variables */
                Total = Script;

                /* Capturamos una celda para mostrar el Reloj */
                return Total;
            }
            /*html2canvas(document.getElementById("grafica"),{onrendered: function (canvas){
            graf=canvas.toDataURL("image/png");
            }
            });*/

            var img = "data:image/jpeg;base64,";

            var centeredText = function (text, y) {
                var textWidth = doc.getStringUnitWidth(text) * doc.internal.getFontSize() / doc.internal.scaleFactor;
                var textOffset = (doc.internal.pageSize.width - textWidth) / 2;
                doc.text(textOffset, y, text);
            }

            var doc = new jsPDF();
            doc.addImage(img, 'JPG', 20, 15, 25, 30);
            doc.setFontSize(7);
            doc.setFont("times", "italic");
            doc.text(150, 10, Reloj());
            doc.setFontStyle("normal");
            doc.setFontSize(20);
            centeredText('Reporte estadístico según importe', 25);
            doc.setFont("Helvetica", "Oblique");
            doc.setFontSize(10);
            doc.text(180, 287, "| Page " + doc.internal.getNumberOfPages().toString());


            const input = document.getElementById(graf);
            const emtHeight = input.offsetHeight;
            const emtWidth = input.offsetWidth;
            const proporcion = emtHeight/emtWidth;
            html2canvas(input)
                .then((canvas) => {
                    const imgData = canvas.toDataURL('image/png');
                    const width = doc.internal.pageSize.width-20;
                    const height = width * proporcion;
                    doc.addImage(imgData, 'JPEG', 10, 50, width, height);
                })
            ;
            
            setTimeout(function(){
                doc.addPage();


                doc.autoTable(columns, rows, {
                    margin: { top: 15 },
                    addPageContent: function (data) {
                        doc.setFont("Helvetica", "Oblique");
                        doc.setFontSize(10);
                        doc.text(180, 287, "| Page " + doc.internal.getNumberOfPages().toString());
                    }
                });

                doc.output('save', 'reporte.pdf');//guardar pdf
            },500);
            
        }

        var data = this.state.tableData;

        var rows = [];
        var aux = [];
        var k = 0;
        for(var i in data){
            aux = [];
            k = 0;
            for(var j in data[i]){
                aux[k] = data[i][j];
                k++;
            }
            rows[i] = aux;
        }

        var columns = ["Concepto", "Importe", "Codigo-Alumno", "Alumno", "Fecha"];

        pdf('grafEst', columns, rows);
    }

    render() {
        return (<div>
            <div className="mb5">
                <button className="btn btn-primary" onClick={this.printDocument}>Print</button>
            </div>
        </div>);
    }
}

export default BtnExport;
